import './DetailedPhoto.css'
import BackArrowIcon from '../assets/LeftArrow.svg'
import { useNavigate, useParams } from 'react-router-dom'
import PhotoSlideshow from '../components/DetailedPhoto/PhotoSlideshow.jsx'
import PhotoInformation from '../components/DetailedPhoto/PhotoInformation.jsx'
import { useEffect, useState } from 'react'
import parameterService from '../services/parameters.js'
import PointcloudView from '../components/DetailedPhoto/PointcloudView.jsx'
import paramatersService from '../services/parameters.js'
import AlertDialogDimensions from '../components/Main/AlertDialogDimensions.jsx'
import { Alert, Snackbar } from '@mui/material'

export default function DetailedPhoto() {

    const navigate = useNavigate()
    const { id } = useParams()
    const [openError, setOpenError] = useState(false);
    const [errorMessage, setErrorMessage] = useState();
    const [openDimensionDialog, setOpenDimensionDialog] = useState(false);
    const [dimensionData, setDimensionData] = useState({})

    const [data, setData] = useState({
        "id": "659136b4ba5c5dfb1568da5f",
            "timestamp": "2023-12-31 09:39:00.018000",
            "brightness": 2,
            "saturation": 0,
            "contrast": 0,
            "image": "",
            "left": "",
            "right": ""
    })

    const [coords, setCoords] = useState({
        x1: -1,
        y1: -1,
        x2: -1,
        y2: -1
    });

    const handleAnalyseClick = async (
    ) => {
        await paramatersService.getObjectDimensions(id, coords, setErrorMessage, setOpenError, setDimensionData, setOpenDimensionDialog)
    };

    const handleClose = (event, reason) => {
        if (reason === "clickaway") {
            return;
        }
        setOpenError(false);
    };

    useEffect(() => {
        const fetchLatestPhoto = async () => {
            try {
                console.log('ID IS: ' + id)
                const response = await fetch(`${parameterService.BASE_URL}/photo?id=${id}`)
                const data = await response.json()
                console.log(data)
                if (!response.ok) {
                    throw new Error(`${response.status} ${parameterService.getErrorMessage(response, data)}`)
                }
                setData(data)
            } catch (error) {
                console.log(error)
            }
        }

        fetchLatestPhoto()
            .catch(console.error)
    }, [])


    return (
        <div className={'detailedPhotoPage'}>
            <AlertDialogDimensions setOpen={setOpenDimensionDialog} open={openDimensionDialog} data={dimensionData} >
            </AlertDialogDimensions>
            <Snackbar
                anchorOrigin={{ vertical: "top", horizontal: "center" }}
                open={openError}
                autoHideDuration={6000}
                onClose={handleClose}
            >
                <Alert
                    onClose={handleClose}
                    severity="error"
                    sx={{ width: "100%", fontSize: 20 }}
                >
                    {errorMessage}
                </Alert>
            </Snackbar>
            <div className={'detailedPageHeader'}>

                <div className={'detailedArrowContainer'}>
                    <img className={'backArrow'} src={BackArrowIcon} alt={''}
                         onClick={() => {
                             navigate('/gallery')
                         }}
                    ></img>
                </div>

                <div className={'detailedPageTitle'}>
                    Photo
                </div>

                <div className={'detailedArrowContainer'}>
                    <img className={'backArrow'} src={BackArrowIcon} alt={''}
                         onClick={() => {
                             navigate('/gallery')
                         }}
                    ></img>
                </div>

            </div>
            <div className={'contentContainer'}>
                <PhotoSlideshow id={id} data={data} coords={coords} setCoords={setCoords} handleAnalyse={handleAnalyseClick}></PhotoSlideshow>
                <PhotoInformation id={id} data={data}></PhotoInformation>
            </div>

        </div>
    )
}